import React from 'react';
import './navbar.css'
import {links} from './navbarlinks'
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import GitHubIcon from '@mui/icons-material/GitHub';
import Button from "@material-ui/core/Button";
function openNav() {
  document.getElementById("mySidebar").style.width = "250px";
  document.getElementById("main").style.marginLeft = "250px";
  console.log('open')
}

function closeNav() {
  document.getElementById("mySidebar").style.width = "0";
  document.getElementById("main").style.marginLeft= "0";
  console.log('closed')
}
function Sidebar() {
  return <div className='Sidebar'>
    <button class="openbtn" onclick="openNav()">â˜° Open Sidebar</button>
    <div id='links'>
    {links.map((link) => {
      return (
        <a id='link2' href={link.url} key={link.id}>{link.text}</a>
      )
    })}

    <Button id='profiles'
        variant="link"
        color=""
        startIcon={< LinkedInIcon style={{ fontSize: 40 }}/>}
        href="https://www.linkedin.com/in/navid-c/"
        target="_blank" rel="noopener noreferrer"
      />
      <Button id='profiles'
        variant="link"
        color=""
        startIcon={< GitHubIcon style={{ fontSize: 40 }}/>}
        href="https://github.com/N-A-V-I-D"
        target="_blank" rel="noopener noreferrer"
      />
    </div>
    
    
  </div>
}

export default Sidebar;
